import ExpenseItem from "./components/ExpenseItem";

function App() {

  const expense = [
    {
      title:"Netflix",
      amount:550,
      date:new Date(2022, 2, 23)
    },
    {
      title:"Piano",
      amount:1500,
      date:new Date(2021, 6, 16)
    },
    {
      title:"Cube",
      amount:100,
      date:new Date(2021, 4, 13)
    },
    {
      title:"Food",
      amount:700,
      date:new Date(2021, 11, 14)
    }
  ]

  return (
    <div>
      <h2>Expense Report!</h2>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
